export const homeobjone = {
    id:'about',
    lightbg: false,
    lighttext: true,
    lighttextdescription: true,
    topline: 'Premium Bank',
    headline: 'Unlimited Transaction with zero fees',
    description: 'Get access to our exclusive app that allows you to send unlimited transcation without getting charged any fees',
    buttonlabel: 'Get Started',
    imgStart: true,
    img: require('../../images/svg-1.svg').default,
    alt:'car',
    dark:true,
    primary:true,
    darktext: false
}

